import ViewWriteStories from './ViewWriteStories';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from './Home';
import NavBar from './NavBar';


function App() {
  return (
    <div>
      {/*
      <ViewStories />
      <TextBox /> */}

      <BrowserRouter>
        <NavBar />
        <Routes>
          <Route path='/' element={<Home />} />
          <Route path='/viewWriteStories' element={<ViewWriteStories artwork={artPiece}/>} />
          {/* artwork="Green-Lake-Stories" */}
        </Routes>
      </BrowserRouter>
   </div>
  );
}

export default App;
